import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Header from '../../component/header/Header';
import Footer from '../../component/footer/Footer';
import './Login.css';

const API = {
  apiGateway: 'https://gxppcdmn7h.execute-api.ap-south-1.amazonaws.com',
};

function Login() {
  const [phoneNumber, setPhoneNumber] = useState('');
  const [isValid, setIsValid] = useState(true);
  const [click, setClick] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();

  const handlePhoneNumberChange = (e) => {
    let value = e.target.value;
    // Filter out non-numeric characters
    value = value.replace(/\D/g, '');
    // Limit to exactly 10 digits
    value = value.slice(0, 10);
    setPhoneNumber(value);
    setIsValid(value.length === 10);
  };

  const handleSubmit = async () => {
    if (isValid) {
      setClick(true);
      setIsLoading(true);
      try {
        const response = await fetch(`${API.apiGateway}/authgw/sendotp`, {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({
            phoneNumber: phoneNumber,
            groupId: 1703228300417,
          }),
        });

        if (response.ok) {
          toast.success('OTP Sent Successfully!', {
            style: {
              backgroundColor: '#008000',
              color: 'white',
              minHeight: '50px',
              fontSize: '16px',
            },
            className: 'custom-toast',
          });
          setTimeout(() => {
            navigate('/verify-otp', { state: { phoneNumber: phoneNumber } });
          }, 2000);
        } else {
          toast.error('Failed To Send OTP. Please Try Again.');
        }
      } catch (error) {
        console.error('Error Sending OTP:', error);
        toast.error('Error Sending OTP. Please Try Again.');
      } finally {
        setIsLoading(false);
        setClick(false);
      }
    } else {
      toast.error('Invalid phone number. Please enter a 10-digit phone number.');
    }
  };

  return (
    <>
      <Header />
      <div className="all-text">
        <div className="margin-top">
          <div className="main-text">Good Morning,</div>
          <div className="second-text">What are you going to learn today?</div>
          <div>
            <label htmlFor="phoneNumber" className="third-text">Login to start</label>
            <div className='conten-display'>
              <div className="inputContainer">
                <input
                  type="text"
                  id="phoneNumber"
                  value={phoneNumber}
                  onChange={handlePhoneNumberChange}
                  placeholder="Enter 10-digit phone number"
                  className={`inputField ${isValid ? '' : 'error'}`}
                />
                {!isValid && <p className="errorText">Please enter a 10-digit phone number.</p>}
              </div>
              <div>
                <button onClick={handleSubmit} className="clickable-buttons" disabled={click || isLoading}>
                  <svg className='adjust-img'
                    xmlns="http://www.w3.org/2000/svg"
                    width="20"
                    height="20"
                    color='black'
                    fill="currentColor"
                    className="bi bi-chevron-right"
                    viewBox="0 0 30 20"
                  >
                    <path
                      fillRule="evenodd"
                      d="M4.646 1.646a.5.5 0 0 1 .708 0l6 6a.5.5 0 0 1 0 .708l-6 6a.5.5 0 0 1-.708-.708L10.293 8 4.646 2.354a.5.5 0 0 1 0-.708"
                    />
                  </svg>
                  <i className="fa-solid fa-angle-right icon_right1"></i>
                </button>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
      <ToastContainer
        position="top-right"
        autoClose={2000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        toastStyle={{ background: "#FF0000", color: "white", minHeight: "50px" }}
      />
    </>
  );
}

export default Login;
